const Die = () => {
  const [clicked, setClicked] = useState(false);
  function handleClicked() {
    setClicked((prevClicked) => !prevClicked);
  }
  const randomNum = Math.floor(Math.random() * 10) + 1;
  return <button className='dice'>{randomNum}</button>;
};

export default Die;
